import React, { Component } from 'react'
import './Getstarted.css';

export default class GetStarted extends Component {
    constructor(){
        super()
        this.state ={
            name:"",
            email: "",
            city: "",
            phone: "",
            error: ""
        }
    }
    handleChange = (name) => (event) =>{
        this.setState({[name]: event.target.value});
     

    }
    render() {
        const {name, email, city, phone} = this.state
        return (
            <div className="qoute-contianer">
                <h2 className="mt-5 mb-5">request qoute</h2>

                <div className="form-qoute">
                    <form className="qoute-form">
                        <lable className ="text" className="form-control"> Name </lable>
                        <input 
                            onChange = {this.handleChange("name")}
                            type="text" 
                            value={name}
                            className="form-control"
                            />
                        <lable className ="email" className="form-control"> Email </lable>
                        <input onChange = {this.handleChange("email")} 
                            type="email" 
                            className="form-control"/>

                    
                        <lable className ="" className="form-control"/> Phone
                        <input type="tel" className="form-control"/>

                   
                        <lable className ="city" className="form-control"/> City
                        <input onChange = {this.handleChange("city")} type="city" className="form-control"/>

                   
                        <lable className ="zip" className="form-control"/> Zip
                        <input onChange = {this.handleChange("zip")} type="zip" className="form-control"/>


                    <button className="btn btn-raised btn-primary">Submit</button>

                </form>
        </div>
                
     </div>
        )
    }
}
